import styled from "styled-components";

export const BodyCard = styled.div``;

export const Member = styled.div`
    position: relative;
    display: inline-block;
    max-width: 25%;
    width: 25%;
    text-align: center;
    padding: 0 20px;
    margin-bottom: 50px;

    .card{
        border-radius: 50%;
        img.photo{
            border-radius: 50%;
        }
        h5{
            color: #fff;
            &.poste{
                font-weight: 300;
            }
        }
        .context{
            position: absolute;
            width: 100%;
            display: block;
            bottom: 20px;
    
            ul.socialNet{
                display: flex;
                list-style: none;
                li{
                    width: 23%;
                    margin: 10px;
                }
            }
        }
    }
    
`;
